import React from 'react'
import { useEffect, useState } from 'react'

const ClothingContainer = props => {
    let [clothes, setClothes] = useState([])

    useEffect(() => {
        fetch('http://localhost:3000/clothes')
        .then(res => res.json())
        .then(data => {
            setClothes(data)
        })
    })

    console.log(clothes)
    return(
        <h1>Hi</h1>
    )

}

export default ClothingContainer
